import { createBrowserHistory } from "history";
const restaurantes = [
    {
        id: 1,
        nombre: 'Tunari',
        imgUrl: 'img/tunari.jpg'
    },
    {
        id: 2,
        nombre: 'Tunari',
        imgUrl: 'img/tunari.jpg'
    },
    {
        id: 1,
        nombre: 'Tunari',
        imgUrl: 'img/tunari.jpg'
    }
];
export default createBrowserHistory();
